import React, { useState } from "react";
import { Link } from "react-router-dom";
import Select from "react-select";
import { Tooltip, OverlayTrigger } from "react-bootstrap";
import { FileUploader } from "react-drag-drop-files";
import Excel from "../../images/common/excel.svg";

const options = [
  { value: "10 Entries", label: "10 Entries" },
  { value: "25 Entries", label: "25 Entries" },
  { value: "50 Entries", label: "50 Entries" },
  { value: "100 Entries", label: "100 Entries" },
];

const fileTypes = ["XLS", "XLSX"];

const UnmatchedMainWindow = () => {
  // Select
  const [selectedOption, setSelectedOption] = useState(null);

  // Drop File
  const [file, setFile] = useState(null);
  const handleChange = (file) => {
    setFile(file);
  };

  // Tooltip
  const renderTooltipBranch = (props) => (
    <Tooltip id="button-tooltip" {...props}>
      Download Branch Master Template
    </Tooltip>
  );

  const renderTooltipTerminal = (props) => (
    <Tooltip id="button-tooltip" {...props}>
      Download Terminal Master Template
    </Tooltip>
  );

  return (
    <div className="unmatchedContainer">
      <div className="d-flex justify-content-between align-items-center breadcrumbHeading">
        <h5 className="fontWeight-600 fileConfigHead colorBlack">
        Unmatched Transactions
        </h5>

        {/* BreadCrumb */}
        <div className="d-flex align-items-center">
          <Link to="/">
            <p className="fontSize12 colorPrimaryDefault">Home</p>
          </Link>
          <span>
            <svg
              width="8"
              height="auto"
              viewBox="0 0 10 16"
              fill="none"
              xmlns="http://www.w3.org/2000/svg"
              className="mx-1"
            >
              <path
                d="M3 4L7 8L3 12"
                stroke="black"
                stroke-width="1.5"
                stroke-linecap="round"
                stroke-linejoin="round"
                className="breadcrumbIcon"
              />
            </svg>
          </span>
          <Link to="/">
            <p className="fontSize12 colorPrimaryDefault">Daily Reports</p>
          </Link>
          <span>
            <svg
              width="8"
              height="auto"
              viewBox="0 0 10 16"
              fill="none"
              xmlns="http://www.w3.org/2000/svg"
              className="mx-1"
            >
              <path
                d="M3 4L7 8L3 12"
                stroke="black"
                stroke-width="1.5"
                stroke-linecap="round"
                stroke-linejoin="round"
                className="breadcrumbIcon"
              />
            </svg>
          </span>
          <Link to="/">
            <p className="fontSize12">Unmatched Transactions</p>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default UnmatchedMainWindow;
